import React, { Component } from "react";

import Image from "./projectImage";
import Link from "next/link";
import { Herd } from "./deleteme";

import SwiperCore, { Navigation, Pagination, Scrollbar, A11y } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";

SwiperCore.use([Navigation, Pagination, Scrollbar, A11y]);

import { ProjectsData } from "./projectData";
import { Project } from "./project";

const Projects = () => {
  var projectList = ProjectsData.map(function (project) {
    return (
      <SwiperSlide>
        <Project key={project.name} projectData={project} />
      </SwiperSlide>
    );
  });

  return <React.Fragment>{projectList}</React.Fragment>;
};

const MyWork = () => {
  return (
    <div className="bg-gray-500 px-4 py-10 md:py-40 w-full" id="my-work">
      <div className="my-4">
        <div className="block overflow-hidden">
          <Swiper
            spaceBetween={0}
            slidesPerView={1.1}
            navigation
            pagination={{ clickable: true }}
            scrollbar={{ draggable: true }}
          >
            <Projects />
          </Swiper>
        </div>
        {/* <div className="md:hidden block h-full">
          <ProjectsMobile />
        </div> */}
      </div>
    </div>
  );
};

export default MyWork;
